from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Button, Color, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up custom colors.
Color.MLIGHTBLUE = Color(197, 84, 99)
Color.MYELLOW = Color(52, 69, 97)
Color.MRED = Color(350, 91, 66)
Color.MBLACK = Color(200, 17, 22)
Color.MWHITE = Color(0, 0, 100)
Color.MLIGHTGREY = Color(203, 31, 84)
Color.MDARKGREY = Color(207, 32, 29)
Color.NOCOLOR = Color(204, 37, 17)

# Set up all devices.
prime_hub = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
color_sensor = ColorSensor(Port.C)
color_sensor.detectable_colors((Color.MLIGHTBLUE, Color.MYELLOW, Color.MLIGHTGREY, Color.MWHITE, Color.MBLACK, Color.MRED, Color.NOCOLOR))
left_wheel = Motor(Port.A, Direction.COUNTERCLOCKWISE)
right_wheel = Motor(Port.B, Direction.CLOCKWISE)
robot = DriveBase(left_wheel, right_wheel, 88, 97)
left_motor = Motor(Port.E, Direction.CLOCKWISE)
right_motor = Motor(Port.F, Direction.CLOCKWISE)

# Initialize variables.
color = 0
lift_angle = 40

async def artifical_habitat():
    await wait(1)
    robot.use_gyro(True)
    robot.settings(straight_speed=1000)
    robot.settings(straight_acceleration=400)
    await turnSpeed()
    await robot.straight(550)
    await robot.straight(-100)
    await multitask(left_motor.run_angle(500, 400), right_motor.run_angle(500, 400))
    await robot.straight(90)
    await multitask(robot.turn(20), right_motor.run_angle(-500, 400))
    await robot.turn(-20)
    await robot.straight(-50)
    await right_motor.run_angle(500, 400)
    await robot.straight(80)
    await robot.turn(20)
    await right_motor.run_angle(-500, 400)
    await robot.turn(-20)
